description:
The world's sexiest therapist at work! How would you like your doctor to order you to have sex as often as possible and with as many different beautiful women as you can? For John Bradley, that's just the cure for his years of impotence. His divorce left him limp, but his sexy therapist manages to straighten him out with some sizzling sexual adventures in her most unusual clinic. The lusty doctor and her sexy nurses take a most personal interest in curing their patients. This delicious doctor just loves her work!

